import React from 'react'

export default function Guidence() {
    return (
        <div className='guidence'>
            <h1><span>עוצמ״א</span> - ערכים לצמיחה עצמית</h1>
            <p> שישה עד שמונה מפגשים אחת לשבוע [כל מפגש למשך שעה]</p>
        </div>
    )
}
